import "../node_modules/bootstrap/dist/css/bootstrap.min.css";


const App=()=>{


    return(

        <>
<h1>MY PORTFOLIO</h1> 

<div className="container home_main">
<div className="row">
<div className="col-md-6 mt-5">
<h2>Sagar Singh</h2>
    <p>To be able to work an encouraging and stable company that will assist me in developing,improving and obtaining<br/>
the neccessary skills in order to become a good in web developer field.</p>
</div>
<div className="col-md-6 mt-5 home_img">
<h2>Sagar Singh</h2>
    <p>To be able to work an encouraging and stable company that will assist me in developing,improving and obtaining<br/>
the neccessary skills in order to become a good in web developer field.</p>

</div>

</div>
</div>

</>

    );

};

export default App;
